// ActiveConsoleの作成
var action_console = document.createElement("div");
action_console.id = "web_assessmentor";
action_console.style.position = "absolute";
action_console.style.bottom = "16px";
action_console.style.left = "16px";
action_console.style.width = "64px";
action_console.style.height = "192px";
action_console.style.zIndex = "10000000000";

var dragFlag = false

action_console.ondragstart = function (event) {
  return false;
}

var timer = null;
var moved = false;

action_console.onmousedown = function(event){
  moved = false;
  document.addEventListener("mousemove",onMouseMove);
  timer = setTimeout(function () {
    dragFlag = true;
    timer = null;
  }, 100)
}

action_console.onmouseup = function(event) {
  dragFlag = false
  if (timer != null) {
    clearTimeout(timer);
    timer = null;
  }
  document.removeEventListener( "mousemove", onMouseMove);
}

var onMouseMove = function(event){
  if (dragFlag === true) {
    moved = true;
    var x = event.clientX + window.scrollX;
    var y = event.clientY + window.scrollY;
    var width = action_console.offsetWidth;
    var height = action_console.offsetHeight;
    action_console.style.top = (y-height/2) + "px";
    action_console.style.left = (x-width/2) + "px";
  }
}

document.getElementsByTagName("body")[0].appendChild(action_console);

var refleshActionConsole = function (good, bad, value) {
  document.getElementById("web_assessmentor_good_counter").innerText = good;
  document.getElementById("web_assessmentor_bad_counter").innerText = bad;
  if (value == 'none') {
    document.getElementById("web_assessmentor_good_background").style.backgroundColor = "#ffffff";
    document.getElementById("web_assessmentor_bad_background").style.backgroundColor = "#ffffff";
  } else if (value == 'good') {
    document.getElementById("web_assessmentor_good_background").style.backgroundColor = "#ebf6fa";
    document.getElementById("web_assessmentor_bad_background").style.backgroundColor = "#ffffff";
  } else if (value == 'bad') {
    document.getElementById("web_assessmentor_good_background").style.backgroundColor = "#ffffff";
    document.getElementById("web_assessmentor_bad_background").style.backgroundColor = "#fbeeee";
  }
};

var good = 0;
var bad = 0;
var value = 'none';

var goodDiff = 0;
var badDiff = 0;

// アブスト表示
chrome.runtime.sendMessage({ id: "abstract", url: location.href.split("?")[0] }, function (data) {
  if (data !== null) {
    good = data.good || 0;
    bad = data.bad || 0;
    value = data.value || 'none';
  }
  action_console.innerHTML = "<div style='width: 100%;height: 100%;background-color: #ffffff;border-radius: 8px;box-shadow: 0 2px 2px #00000080;overflow: hidden;'>"
    +"<div id='web_assessmentor_good_background'><a href='javascript: void(0)' id='web_assessmentor_good' style='width: 64px;height:64px;display: flex;flex-direction: column;justify-content: center;text-align: center;' onmouseover='this.style.backgroundColor=\"#ebf6fa\"' onmouseout='this.style.backgroundColor=\"transparent\"'><div><img src='data:image/png;base64,\n' width='20' height='20'><br/><font color='#3aabd2' id='web_assessmentor_good_counter'>"+good+"</font></div></a></div>"
    +"<div id='web_assessmentor_bad_background'><a href='javascript: void(0)' id='web_assessmentor_bad' style='width: 64px;height:64px;display: flex;flex-direction: column;justify-content: center;text-align: center;' onmouseover='this.style.backgroundColor=\"#fbeeee\"' onmouseout='this.style.backgroundColor=\"transparent\"'><div><img src='data:image/png;base64,\n' width='20' height='20'><br/><font color='#df5656' id='web_assessmentor_bad_counter'>"+bad+"</font></div></a></div>"
    +"<a href='https://google.co.jp' target='_blank' style='width: 64px;height:64px;display: flex;flex-direction: column;justify-content: center;text-align: center;' onmouseover='this.style.backgroundColor=\"#f0f0f0\"' onmouseout='this.style.backgroundColor=\"#ffffff\"'><div><img src='data:image/png;base64,\n' width='20' height='20'><br/><font color='#474747'>詳細</font></div></a>"
    +"</div>";
  refleshActionConsole(good, bad, value)

  document.getElementById("web_assessmentor_good").addEventListener('click', function(event) {
    if (moved == true) return false;
    if (value == 'none') {
      goodDiff = 1;
      badDiff = 0;
      value = 'good';
    } else if (value == 'good') {
      goodDiff = -1;
      badDiff = 0;
      value = 'none';
    } else if (value == 'bad') {
      badDiff = -1;
      goodDiff = 1;
      value = 'good';
    }
    bad += badDiff
    good += goodDiff
    refleshActionConsole(good, bad, value)
    chrome.runtime.sendMessage({ id: "assessment", url: location.href.split("?")[0], title: document.title, value: value, goodDiff: goodDiff, badDiff: badDiff }, function (data) {
      console.log(data)
    });
  });

  document.getElementById("web_assessmentor_bad").addEventListener('click', function(event){
    if (moved == true) return false;
    if (value == 'none') {
      badDiff  = 1;
      goodDiff = 0;
      value = 'bad';
    } else if (value == 'good') {
      goodDiff = -1;
      badDiff = 1;
      value = 'bad';
    } else if (value == 'bad') {
      badDiff = -1;
      goodDiff = 0;
      value = 'none';
    }
    bad += badDiff
    good += goodDiff
    refleshActionConsole(good, bad, value)
    chrome.runtime.sendMessage({ id: "assessment", url: location.href.split("?")[0], title: document.title, value: value, goodDiff: goodDiff, badDiff: badDiff }, function (data) {
      console.log(data)
    });
  });

});
